import React, { useState, useEffect } from 'react'
import _AxiosInstance from '../Store/_AxiosInstance'
import { Grid, Image } from 'semantic-ui-react'

const DisplayAllGeresOfMovies = props => {

    return (
        <React.Fragment>
            <center className="customImageDisplay">
                <Image inline onClick={() => props.movieDetials(ITypeMovie)} src={`https://image.tmdb.org/t/p/original/${props.movie.poster_path}`}
                    className='sizeOfNewSearchMovie'
                />
            </center>
        </React.Fragment>

    )
}

export default DisplayAllGeresOfMovies;
